import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "../components/Home/home";
import Korea from "../components/Home/korea";

function Routes() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          {/* <Home /> */}
          <Korea></Korea>
        </Route>
      </Switch>
    </Router>
  );
}

export default Routes;
